import "./MainSection.css";
import Cat from "./Cat.js";

function MainSection() {
  return (
    <div class="MainSection">
        <div class="Content">
            <p>This is the content</p>
        </div>

        <div class="SideBar">
            <Cat name ="Bob"/>
            <Cat name ="Alice"/>
            <Cat name ="Theodore"/>
            <Cat />
        </div>

    </div>
  );
}

export default MainSection;
